import React from 'react'

function searchbar() {
  return (
    <div className='text-center'>
        <div className="form">
         <label htmlFor="searchbar" className='text-light ms-5'>Find: &nbsp; </label>
            <input type="text" className="form-control w-25" style={{display:"inline",marginRight:"-800px",marginBottom:"25px",background:"#000000",color:"white",fontWeight:"500"}} placeholder='Search' id='searchbar'/>
 
        </div>
    </div>
  )
}

export default searchbar
